/*Table structure for table `tp_student` */

DROP TABLE IF EXISTS `tp_student`;

CREATE TABLE `tp_student` (
  `s_id` varchar(11) NOT NULL COMMENT '学生学号',
  `s_name` varchar(4) NOT NULL COMMENT '学生姓名',
  `c_name` varchar(16) NOT NULL,
  PRIMARY KEY (`s_id`)
